import './App.css';

var axios = require('axios');
// var data = JSON.stringify({
//   "short_description": "Description providedDDDD"
// });

var data = ''

var config = {
  method: 'get',
  url: 'https://dev75752.service-now.com/api/now/table/incident?priority=2',
  headers: { 
    'Content-Type': 'application/json', 
    'Authorization': 'Basic YWRtaW46bVdYYThvYmxIOEVJ', 
    'Cookie': 'BIGipServerpool_dev75752=2609600522.40766.0000; JSESSIONID=BF1A5BE7C10897C4D3B142F8E81879D0; glide_session_store=AA10742C97795110A6C0341E6253AF03; glide_user_activity=U0N2M18xOmZkeGFFMCtyWEt5czllRkNLVDRyTk5DRkpWNUR6aCtoNlFDNDhCaVVVZVE9OnE2cjArQXU0L2JlK292UWZ2aHVhRi8xaVltWHR1UHZSdHJ1dEpVNkZTQVU9; glide_user_route=glide.80b7fa92314a6346bf2701360a9b4edb'
  },
  data : data
};

axios(config)
.then(function (response) {
  //console.log(JSON.stringify(response.data));
  const arr = [];
  let counter = 0;
  response.data.result.forEach(element => {
    arr.push(element.number)
    counter ++;
  });
  console.log(arr);
  console.log(`Counter: ${counter}`)
})
.catch(function (error) {
  console.log(error);
});

function App() {
  return (
